hljs.registerLanguage("dockerfile", (() => {
  "use strict";
  return ({HASH_COMMENT_MODE, APOS_STRING_MODE, QUOTE_STRING_MODE, NUMBER_MODE}) => {
    return {
      name: "Dockerfile",
      aliases: ["docker"],
      case_insensitive: !0,
      keywords: "from maintainer expose env arg user onbuild stopsignal",
      contains: [
        HASH_COMMENT_MODE,
        APOS_STRING_MODE,
        QUOTE_STRING_MODE,
        NUMBER_MODE,
        {
          beginKeywords:
            "run cmd entrypoint volume add copy workdir label healthcheck shell",
          starts: { end: /[^\\]$/, subLanguage: "bash" },
        },
      ],
      illegal: "</",
    };
  };
})());
